module ring_counter (
    input clk,
    input reset,
    output reg [7:0] out
);

reg [2:0] count;

initial begin
    count = 3'b001;
end

always @(posedge clk or posedge reset) begin
    if (reset)
        count <= 3'b001;
    else
        count <= count == 3'b111 ? 3'b001 : count + 1;
end

assign out = 8'b0000_0000;
out[count] = 1'b1;

endmodule

module ring_counter (
    input wire clk,
    input wire reset,
    output reg [7:0] out
);

reg [3:0] counter;

always @(posedge clk or posedge reset) begin
    if (reset) begin
        counter <= 4'b0001;
    end else begin
        counter <= counter << 1;
        if (counter == 8'b1000_0000) begin
            counter <= 4'b0001;
        end
    end
end

assign out = 8'b0 << counter;

endmodule

